import React from "react";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBoxOpen, faCartArrowDown, faChartPie, faChevronDown, faClipboard, faCommentDots, faFileAlt, faPlus, faRocket, faStore } from '@fortawesome/free-solid-svg-icons';
import { ChoosePhotoWidget, ProfileCardWidget } from "../../components/Widgets";
import { GeneralInfoForm } from "../../components/Forms";
import { faBook, faExternalLinkAlt, faTimesCircle, faCheckCircle, faCalendarAlt, faCodeBranch, faShoppingCart, faFolder, faMapMarkedAlt, faPager, faFileCode, faDownload } from "@fortawesome/free-solid-svg-icons";
import { faAngleLeft, faEnvelope, faUnlockAlt } from "@fortawesome/free-solid-svg-icons";
import { Col, Row, Form, Card, ListGroup, Button, FormCheck, Container, InputGroup, Dropdown } from '@themesberg/react-bootstrap';
import { Link } from 'react-router-dom';
import { Routes } from "../../routes";


import Profile3 from "../../assets/img/team/profile-picture-3.jpg";


export default () => {
  return (
    <>
    <Container>
    <p className="text-center">
            <Card.Link as={Link} to={Routes.Presentation.path} className="text-gray-700">
              <FontAwesomeIcon icon={faAngleLeft} className="me-2" /> Back to homepage
            </Card.Link>
          </p>
          </Container>
      <Row>
      <div className="d-flex align-items-center justify-content-center">
            <Col xs={16} md={10} lg={6} className="mb-5 mb-lg-0">
              <Card border="light" className="p-4">
                <Card.Header className="bg-white border-0 pb-0">
                  <span className="d-block">
                    <h2 className="text-primary fw-bold align-top">About Us</h2>
                  </span>
                </Card.Header>
                <Card.Body>
                  <ListGroup className="list-group-flush price-list">
                    <ListGroup.Item className="bg-white border-0 ps-0">
                      <strong>Phone number: </strong> +353 (083)427-4000
                    </ListGroup.Item>

                  </ListGroup>
                </Card.Body>
              </Card>
            </Col>
            </div>
       </Row>

        <Col xs={12} xl={4}>
          <Row>
            <Col xs={12}>
              {/* <ProfileCardWidget /> */}
            </Col>

          </Row>
        </Col>
    </>
  );
};
